import { MDBBadge, MDBBtn, MDBTable, MDBTableHead, MDBTableBody } from 'mdb-react-ui-kit';
import React, { useEffect, useState } from 'react';
import axios from 'axios';

const RequestReceived = () => {
  const [request, setRequest] = useState([]);

  useEffect(() => {
    // Fetch request data using axios and update the state
    const fetchRequestData = async () => {
      try {
        const response = await axios.get('https://localhost:7026/AdminSide/GetDashboardImage');
        console.log(response.data);
        setRequest(response.data); // Assuming the API response contains the data for requests
      } catch (error) {
        console.error(error);
      }
    };

    fetchRequestData();
  }, []);

  return (
    <div>
      <MDBTable align='middle'>
        <MDBTableHead>
          <tr>
            <th scope='col'>Name</th>
            <th scope='col'>Agency Name</th>
            <th scope='col'>Age</th>
            <th scope='col'>Experience</th>
            <th scope='col'>Email-Id</th>
            <th scope='col'>Phone Number</th>
            <th scope='col'>Decision</th>
          </tr>
        </MDBTableHead>
        <MDBTableBody>
          {request.map((item, index) => (
            <tr key={index}>
              <td>{item.name}</td>
              <td>{item.agencyName}</td>
              <td>{item.age}</td>
              <td>{item.experience}</td>
              <td>{item.email}</td>
              <td>{item.phoneNumber}</td>
              <td>
                {/* You can add decision buttons or badges here */}
                <MDBBadge color='success'>Approved</MDBBadge>
                {/* <MDBBadge color='danger'>Rejected</MDBBadge> */}
              </td>
            </tr>
          ))}
        </MDBTableBody>
      </MDBTable>
    </div>
  );
};

export default RequestReceived;
